import React from 'react';
import { Route, Switch } from "react-router-dom";
import Accueil from "./component/Acceuil/Accueil";

function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/">
          <Accueil/>
          </Route>
          </Switch>      
    </div>
  );
}

export default App;
